(1, 1, 'en', 'អាវកីឡាករជម្រើសជាតិអាហ្សង់ទីន 2023/2024', '<p>ធានាគុណភាព 100%</p>\n<p>ធានាសាច់ក្រណាត់ស្អាតដូចរូប 100%</p>\n<p>ល្អនិងមានគុណភាពធានារាល់ការកម្ម៉ុង 100%</p>\n<p>ជាប្រភេទអាវ Top Grade&nbsp;</p>', NULL),
